INSERT INTO `my_eqs` VALUES (1,'Worry / Anxiety','<div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<ol><li>Locate the pressure point as shown</li>\r\n<li>Use the tip of your thumb to find the point\r\non your wrist crease, and hold for up to 2 minutes</li>\r\n<li>Repeat to the other side if necessary</li>\r\n</ol>\r\n\r\n\r\n\r\n\r\n\r\n</div>\r\n','<h3>What are you worrying or anxious about?</h3>\r\n<ol><li>Make an assessment ( what is actually happening) not a judgement ( what you like or dislike, what you think is good or bad, or judge to be right or wrong )</li>\r\n<li>What\'s the evidence according to your assessment?</li>\r\n<li>Write it down if possible</li>\r\n<li>The facts represent the actual situation and not what you may judge it to be or what you might like it to be</li>\r\n</ol>\r\n<br />',0,'2011-09-06 02:41:12','2012-07-13 20:29:14','<h2>Worry</h2>\r\n<p>A feeeling of uneasiness caused by apprehension of possible misfortune or danger</p>\r\n<h2>Anxiety</h2>\r\n<p>Tension caused by the thought of something not working out as hoped or planned</p>\r\n<br />\r\n\r\n','<h3>Develop a strategy</h3>\r\n<p>Your strategy is your plan of action for dealing with the identified disturbance. It reflects the changes you can make in the way that you respond to such situations, whether people or events.</p>\r\n<p>In developing your strategy, it is important to remember that you can only take responsibility for, and therefore only change, yourself and the way that you allow situations and people to affect you.</p>\r\n<p>Having identified the facts of the situation, determine your desired outcomes:</p>\r\n<ul><li>What do you want to change?&#160;</li>\r\n<li>What resources do you have available?</li>\r\n<li>What resources can you develop?</li>\r\n<li>How can you use your resources now and in the future to&#160;facilitate change?</li>\r\n<li>When can you begin to make changes?</li>\r\n</ul>\r\n<p>Write it down if possible</p>\r\n<p>Using your resources and strategy, begin to respond rather than react to the situation.</p>\r\n<p>Observe the changes as they occur.</p>',3,'http://vimeo.com/31478559','http://vimeo.com/31478578','<object id=\"wistia_1144481\" classid=\"clsid:D27CDB6E-AE6D-11cf-96B8-444553540000\" width=\"960\" height=\"540\"><param name=\"allowfullscreen\" value=\"true\" /><param name=\"allowscriptaccess\" value=\"always\" /><param name=\"wmode\" value=\"opaque\" /><param name=\"flashvars\" value=\"videoUrl=http://embed.wistia.com/deliveries/59caedf327cd563d220eb1d1be104b7394f8055a.bin&stillUrl=http://embed.wistia.com/deliveries/2b3d009afdd0c16148455243895d05a6c4dca021.bin&playButtonVisible=true&controlsVisibleOnLoad=false&unbufferedSeek=true&autoLoad=false&autoPlay=false&endVideoBehavior=default&embedServiceURL=http://distillery.wistia.com/x&accountKey=wistia-production_14223&mediaID=wistia-production_1144481&mediaDuration=20.4\" /><param name=\"movie\" value=\"http://embed.wistia.com/flash/embed_player_v2.0.swf\" /><embed src=\"http://embed.wistia.com/flash/embed_player_v2.0.swf\" name=\"wistia_1144481\" type=\"application/x-shockwave-flash\" width=\"960\" height=\"540\" allowfullscreen=\"true\" allowscriptaccess=\"always\" wmode=\"opaque\" flashvars=\"videoUrl=http://embed.wistia.com/deliveries/59caedf327cd563d220eb1d1be104b7394f8055a.bin&stillUrl=http://embed.wistia.com/deliveries/2b3d009afdd0c16148455243895d05a6c4dca021.bin&playButtonVisible=true&controlsVisibleOnLoad=false&unbufferedSeek=true&autoLoad=false&autoPlay=false&endVideoBehavior=default&embedServiceURL=http://distillery.wistia.com/x&accountKey=wistia-production_14223&mediaID=wistia-production_1144481&mediaDuration=20.4\"></embed></object><script src=\"http://embed.wistia.com/embeds/v.js\"></script><script>if(!navigator.mimeTypes[\'application/x-shockwave-flash\'] || navigator.userAgent.match(/Android/i)!==null)Wistia.VideoEmbed(\'wistia_1144481\',\'960\',\'540\',{videoUrl:\'http://embed.wistia.com/deliveries/201493106002710c46da5f4b3a1cc181b3ce72ae.bin\',stillUrl:\'http://embed.wistia.com/deliveries/2b3d009afdd0c16148455243895d05a6c4dca021.bin\',distilleryUrl:\'http://distillery.wistia.com/x\',accountKey:\'wistia-production_14223\',mediaId:\'wistia-production_1144481\',mediaDuration:20.4})</script>','<object id=\"wistia_1144483\" classid=\"clsid:D27CDB6E-AE6D-11cf-96B8-444553540000\" width=\"960\" height=\"540\"><param name=\"allowfullscreen\" value=\"true\" /><param name=\"allowscriptaccess\" value=\"always\" /><param name=\"wmode\" value=\"opaque\" /><param name=\"flashvars\" value=\"videoUrl=http://embed.wistia.com/deliveries/32951d5de9a6e1d81d37ef8dcb581185e0a16be9.bin&stillUrl=http://embed.wistia.com/deliveries/7dae8fde9dca20bbfe78aa215243a6204397769e.bin&playButtonVisible=true&controlsVisibleOnLoad=false&unbufferedSeek=true&autoLoad=false&autoPlay=false&endVideoBehavior=default&embedServiceURL=http://distillery.wistia.com/x&accountKey=wistia-production_14223&mediaID=wistia-production_1144483&mediaDuration=30.0\" /><param name=\"movie\" value=\"http://embed.wistia.com/flash/embed_player_v2.0.swf\" /><embed src=\"http://embed.wistia.com/flash/embed_player_v2.0.swf\" name=\"wistia_1144483\" type=\"application/x-shockwave-flash\" width=\"960\" height=\"540\" allowfullscreen=\"true\" allowscriptaccess=\"always\" wmode=\"opaque\" flashvars=\"videoUrl=http://embed.wistia.com/deliveries/32951d5de9a6e1d81d37ef8dcb581185e0a16be9.bin&stillUrl=http://embed.wistia.com/deliveries/7dae8fde9dca20bbfe78aa215243a6204397769e.bin&playButtonVisible=true&controlsVisibleOnLoad=false&unbufferedSeek=true&autoLoad=false&autoPlay=false&endVideoBehavior=default&embedServiceURL=http://distillery.wistia.com/x&accountKey=wistia-production_14223&mediaID=wistia-production_1144483&mediaDuration=30.0\"></embed></object><script src=\"http://embed.wistia.com/embeds/v.js\"></script><script>if(!navigator.mimeTypes[\'application/x-shockwave-flash\'] || navigator.userAgent.match(/Android/i)!==null)Wistia.VideoEmbed(\'wistia_1144483\',\'960\',\'540\',{videoUrl:\'http://embed.wistia.com/deliveries/1b17b9dc137cce3c8c9f18bae8df3ab5780e016d.bin\',stillUrl:\'http://embed.wistia.com/deliveries/7dae8fde9dca20bbfe78aa215243a6204397769e.bin\',distilleryUrl:\'http://distillery.wistia.com/x\',accountKey:\'wistia-production_14223\',mediaId:\'wistia-production_1144483\',mediaDuration:30.0})</script>','1144481','1144483'),(2,'Insecure / Fearful','<ul><li>Locate the pressure point as shown</li>\r\n<li>Press in between your ankle bone and achilles tendon on the inside of your leg, and hold the point for up to 2 minutes</li>\r\n<li>Repeat to the other side if necessary</li>\r\n</ul>','<h2>What are you insecure or fearful about?</h2>\r\n<ol><li>Make an assessment (what is actually happening) not a judgement (what you like or dislike, what you think is good or bad, or judge to be right or wrong)</li>\r\n<li>What\'s the evidence according to your assessment?</li>\r\n<li>Write it down if possible</li>\r\n<li>The facts represent the actual situation and not what you may judge it to be or what you might like it to be</li>\r\n</ol>',1,'2011-09-06 03:41:00','2012-07-13 20:29:43','<h2>Insecure</h2>\r\n<p>Unstable, not confident, uncertain about the future, not adequately protected</p>\r\n<h2>Fearful</h2>\r\n<p>Afraid</p>','<h3>Develop a strategy</h3>\r\n<p>Your strategy is your plan of action for dealing with the identified disturbance. It reflects the changes you can make in the way that you respond to such situations, whether people or events.</p>\r\n<p>In developing your strategy, it is important to remember that you can only take responsibility for, and therefore only change, yourself and the way that you allow situations and people to affect you.</p>\r\n<p>Having identified the facts of the situation, determine your desired outcomes:</p>\r\n<ul><li>What do you want to change?&#160;</li>\r\n<li>What resources do you have available?</li>\r\n<li>What resources can you develop?</li>\r\n<li>How can you use your resources now and in the future to&#160;facilitate change?</li>\r\n<li>When can you begin to make changes?</li>\r\n</ul>\r\n<p>Write it down if possible</p>\r\n<p>Using your resources and strategy, begin to respond rather than react to the situation.</p>\r\n<p>Observe the changes as they occur.</p>',23,'http://vimeo.com/31478559','http://vimeo.com/31478578','<object id=\"wistia_1144481\" classid=\"clsid:D27CDB6E-AE6D-11cf-96B8-444553540000\" width=\"960\" height=\"540\"><param name=\"allowfullscreen\" value=\"true\" /><param name=\"allowscriptaccess\" value=\"always\" /><param name=\"wmode\" value=\"opaque\" /><param name=\"flashvars\" value=\"videoUrl=http://embed.wistia.com/deliveries/59caedf327cd563d220eb1d1be104b7394f8055a.bin&stillUrl=http://embed.wistia.com/deliveries/2b3d009afdd0c16148455243895d05a6c4dca021.bin&playButtonVisible=true&controlsVisibleOnLoad=false&unbufferedSeek=true&autoLoad=false&autoPlay=false&endVideoBehavior=default&embedServiceURL=http://distillery.wistia.com/x&accountKey=wistia-production_14223&mediaID=wistia-production_1144481&mediaDuration=20.4\" /><param name=\"movie\" value=\"http://embed.wistia.com/flash/embed_player_v2.0.swf\" /><embed src=\"http://embed.wistia.com/flash/embed_player_v2.0.swf\" name=\"wistia_1144481\" type=\"application/x-shockwave-flash\" width=\"960\" height=\"540\" allowfullscreen=\"true\" allowscriptaccess=\"always\" wmode=\"opaque\" flashvars=\"videoUrl=http://embed.wistia.com/deliveries/59caedf327cd563d220eb1d1be104b7394f8055a.bin&stillUrl=http://embed.wistia.com/deliveries/2b3d009afdd0c16148455243895d05a6c4dca021.bin&playButtonVisible=true&controlsVisibleOnLoad=false&unbufferedSeek=true&autoLoad=false&autoPlay=false&endVideoBehavior=default&embedServiceURL=http://distillery.wistia.com/x&accountKey=wistia-production_14223&mediaID=wistia-production_1144481&mediaDuration=20.4\"></embed></object><script src=\"http://embed.wistia.com/embeds/v.js\"></script><script>if(!navigator.mimeTypes[\'application/x-shockwave-flash\']