fied disturbance. It reflects the changes you can make in the way that you respond to such situations, whether people or events.</p>\r\n<p>In developing your strategy, it is important to remember that you can only take responsibility for, and therefore only change, yourself and the way that you allow situations and people to affect you.</p>\r\n<p>Having identified the facts of the situation, determine your desired outcomes:</p>\r\n<ul><li>What do you want to change?&#160;</li>\r\n<li>What resources do you have available?</li>\r\n<li>What resources can you develop?</li>\r\n<li>How can you use your resources now and in the future to&#160;facilitate change?</li>\r\n<li>When can you begin to make changes?</li>\r\n</ul>\r\n<p>Write it down if possible</p>\r\n<p>Using your resources and strategy, begin to respond rather than react to the situation.</p>\r\n<p>Observe the changes as they occur.</p>',5,'http://vimeo.com/31478559','http://vimeo.com/31478578','<object id=\"wistia_1144481\" classid=\"clsid:D27CDB6E-AE6D-11cf-96B8-444553540000\" width=\"960\" height=\"540\"><param name=\"allowfullscreen\" value=\"true\" /><param name=\"allowscriptaccess\" value=\"always\" /><param name=\"wmode\" value=\"opaque\" /><param name=\"flashvars\" value=\"videoUrl=http://embed.wistia.com/deliveries/59caedf327cd563d220eb1d1be104b7394f8055a.bin&stillUrl=http://embed.wistia.com/deliveries/2b3d009afdd0c16148455243895d05a6c4dca021.bin&playButtonVisible=true&controlsVisibleOnLoad=false&unbufferedSeek=true&autoLoad=false&autoPlay=false&endVideoBehavior=default&embedServiceURL=http://distillery.wistia.com/x&accountKey=wistia-production_14223&mediaID=wistia-production_1144481&mediaDuration=20.4\" /><param name=\"movie\" value=\"http://embed.wistia.com/flash/embed_player_v2.0.swf\" /><embed src=\"http://embed.wistia.com/flash/embed_player_v2.0.swf\" name=\"wistia_1144481\" type=\"application/x-shockwave-flash\" width=\"960\" height=\"540\" allowfullscreen=\"true\" allowscriptaccess=\"always\" wmo