ase the scope of this warranty, and you may not rely on any such information or advice.</p>\r\n<p>Nothing in this Agreement is intended or shall be construed as excluding or modifying any statutory rights, warranties or conditions which are applicable to this Agreement or My 5 Online supplied hereunder, and which by virtue of any national or State Fair Trading, Trade Practices or other consumer legislation may not be modified or excluded.  If permitted by such legislation, however, My 5\'s liability for any breach of any such warranty or condition shall be and is hereby limited to the correction of any defect in such part of My 5 Online licensed hereunder as My 5 at its sole discretion may determine to be necessary to correct the said breach.</p>\r\n<p>Except as set out in this document, in no event shall My 5 be liable for any special, incidental, indirect or consequential damages (including, without limitation, damages for loss of business profits, business interruption, and loss of business information or computer programs), even if My 5 or any My 5 representative has been advised of the possibility of such damages.</p>\r\n<h3>GENERAL</h3>\r\n<p>This Agreement will be construed under the laws of &#160;New South Wales, Australia and you and My 5 submit to the non-exclusive jurisdiction of the courts of New South Wales.  This Agreement contains the entire Agreement between the parties hereto with respect to the subject matter hereof, and supersedes all prior agreements and/or understandings (oral or written).  Failure or delay by My 5 in enforcing any right or provision hereof shall not be deemed a waiver of such provision or right with respect to the instant or any subsequent breach.  If any provision of this Agreement shall be held by a court of competent jurisdiction to be contrary to law, that provision will be enforced to the maximum extent permissible, and the remaining provisions of this Agreement will remain in full force and effect</p>','2011-10-26 11:23:53','2011-12-02 02:00:04'),(87,87,'en','','2011-10-26 11:23:53','2011-10-26 11:23:53'),(88,88,'en','<h3>1.              What information do we collect?</h3>\r\n<p>We collect information from you when you register on our site, place an order, subscribe to our newsletter, respond to a survey or fill out a form.  When ordering or registering on our site, as appropriate, you may be asked to enter your name, e-mail address, mailing address or credit card information. You may, however, visit our site anonymously.</p>\r\n<h3>2.              What do we use your information for?</h3>\r\n<p>Any of the information we collect from you may be used in one of the following ways:</p>\r\n<ul><li>To personalize your experience – your information helps us to better respond to your individual needs</li>\r\n<li>To improve our website – we continually strive to improve our website offerings based on the information and feedback we receive from you</li>\r\n<li>To improve customer service – your information helps us to more effectively respond to your customer service requests and support needs</li>\r\n<li>To process transactions – your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested</li>\r\n<li>To administer a contest, promotion, survey or other site feature</li>\r\n<li>To send periodic emails – the email address you provide for order processing, will only be used to send you information and updates pertaining to your order and to My 5 Online and related services.  If at any time you would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.</li>\r\n</ul>\r\n<h3>3.              How do we protect your information?</h3>\r\n<p>We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.<br />We offer the use of a secure server. All supplied sensitive/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our database to be only accessed by those authorized with special access rights to our systems, and are required to keep the information confidential.  After a transaction, your private information (credit cards, social security numbers, financials, etc.) will not be stored on our servers.</p>\r\n<h3>4.              Do we use cookies?</h3>\r\n<p>My 5 uses cookies to understand and save your preferences for future visits and compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future. We may contract with third-party service providers to assist us in better understanding our site visitors. These service providers are not permitted to use the information collected on our behalf except to help us conduct and improve our business.  Cookies are small files that a site or its service provider transfers to your computer\'s hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information</p>\r\n<h3>5.              Do we disclose any information to outside parties?</h3>\r\n<p>We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or other\'s rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.</p>\r\n<h3>6.              Third party links</h3>\r\n<p>Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.</p>\r\n<h3>7.              California Online Privacy Protection Act Compliance</h3>\r\n<p>Because we value your privacy we have taken the necessary precautions to be in compliance with the California Online Privacy Protection Act. We therefore will not distribute your personal information to outside parties without your consent.</p>\r\n<p>As part of the California Online Privacy Protection Act, all users of our site may make any changes to their information at anytime by logging into their control panel and going to the \'Edit Profile\' page.</p>\r\n<h3>8.              Children’s Online Privacy Protection Act Compliance</h3>\r\n<p>We are in compliance with the requirements of COPPA (Children\'s Online Privacy Protection Act), we do not collect any information from anyone under 13 years of age. Our website, products and services are all directed to people who are at least 13 years old or older.</p>\r\n<h3>9.              Online Privacy Policy Only</h3>\r\n<p>This online privacy policy applies only to information collected through our website and not to information collected offline.</p>\r\n<h3>10.          Other information</h3>\r\n<p>Please also visit our <a href=\"/home/about-my-5/terms-and-conditions--2\" title=\"Terms and Conditions\">Terms and Conditions\r\n</a> section establishing the use, disclaimers, and limitations of liability governing the use of our website at http://www.my5.com.au</p>\r\n<h3>11.          Your Consent</h3>\r\n<p>By using our site, you consent to our web site privacy policy.<br />If we decide to change our privacy policy, we will post those changes on this page, and/or update the Privacy Policy modification date below.  This policy was last modified on 27/10/2011</p>\r\n<h3>12.          Contacting Us</h3>\r\n<p>If there are any questions regarding this privacy policy you may contact us by email to support@my5.com.au</p>','2011-10-26 11:33:59','2011-12-02 02:03:21'),(89,89,'en','','2011-10-26 11:33:59','2011-10-26 11:33:59'),(90,90,'en','<h3>1. What information do we collect?</h3>\r\n<p>We collect information from you when you register on our site, place an order, subscribe to our newsletter, respond to a survey or fill out a form.  When ordering or registering on our site, as appropriate, you may be asked to enter your name, e-mail address, mailing address or credit card information. You may, however, visit our site anonymously.</p>\r\n<h3>2. What do we use your information for?</h3>\r\n<p>Any of the information we collect from you may be used in one of the following ways:</p>\r\n<ul><li>To personalize your experience – your information helps us to better respond to your individual needs</li>\r\n<li>To improve our website – we continually strive to improve our website offerings based on the information and feedback we receive from you</li>\r\n<li>To improve customer service – your information helps us to more effectively respond to your customer service requests and support needs</li>\r\n<li>To process transactions – your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested</li>\r\n<li>To administer a contest, promotion, survey or other site feature</li>\r\n<li>To send periodic emails – the email address you provide for order processing, will only be used to send you information and updates pertaining to your order and to My 5 Online and related s