ree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.</p>\r\n<h3>6.              Third party links</h3>\r\n<p>Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.</p>\r\n<h3>7.              California Online Privacy Protection Act Compliance</h3>\r\n<p>Because we value your privacy we have taken the necessary precautions to be in compliance with the California Online Privacy Protection Act. We therefore will not distribute your personal information to outside parties without your consent.<br />As part of the California Online Privacy Protection Act, all users of our site may make any changes to their information at anytime by logging into their control panel and going to the \'Edit Profile\' page.</p>\r\n<h3>8.              Children’s Online Privacy Protection Act Compliance</h3>\r\n<p>We are in compliance with the requirements of COPPA (Childrens Online Privacy Protection Act), we do not collect any information from anyone under 13 years of age. Our website, products and services are all directed to people who are at least 13 years old or older.</p>\r\n<h3>9.              Online Privacy Policy Only</h3>\r\n<p>This online privacy policy applies only to information collected through our website and not to information collected offline.</p>\r\n<h3>10.          Other information</h3>\r\n<p>Please also visit our Terms and Conditions section establishing the use, disclaimers, and limitations of liability governing the use of our website at http://www.my5.com.au</p>\r\n<h3>11.          Your Consent</h3>\r\n<p>By using our site, you consent to our web site privacy policy.<br />If we decide to change our privacy policy, we will post those changes on this page, and/or update the Privacy Policy modification date below.&#160;This policy was last modified on 27/10/2011</p>\r\n<h3>12.          Contacting Us</h3>\r\n<p>If there are any questions regarding this privacy policy you may contact us by email to support@my5.com.au</p>','2011-10-26 11:54:54','2011-10-27 21:49:51'),(91,91,'en','','2011-10-26 11:54:54','2011-10-26 11:54:54'),(92,92,'en','<h2>Seminars</h2>\r\n\r\n<p class=\"text-align-left\">My 5 offers a variety of ways to support the wellbeing culture within your organisation by providing a wide range of seminars facilitated by a team of accredited health professionals.</p>\r\n<p>The seminars can be packaged in a flexible offering alongside the My 5 on line wellbeing program to offer you a truly holistic workplace wellbeing program.</p>\r\n<p>Our range of seminars can be specifically tailored to suit your needs. We offer:</p>\r\n<ul><li>Stretching and posture for the workplace</li>\r\n<li>Back and spine care</li>\r\n<li>Meditation and relaxation</li>\r\n<li>Nutrition and healthy eating at work</li>\r\n<li>Self-massage</li>\r\n<li>Tai chi and yoga</li>\r\n</ul>\r\n<p>We will continue to support your workforce with regular newsletters and health tips relevant to the workplace environment.</p>\r\n<h2>Assessments&#160;&#160;&#160;</h2>\r\n<p>My 5 in association with <a target=\"_blank\" title=\"http://www.wellnessteam.com.au\" href=\"http://www.wellnessteam.com.au\">Wellness Team</a> can offer health assessments utilizing innovative technology that engages your employees and helps them increase their own health awareness whilst taking more responsibility for their own health.</p>\r\n<p>The BioPhotonic Scanner utilises unique and patented Nobel Prize winning technology. It provides an innovative way to measure the carotenoid antioxidant levels in the body, giving you an indicator of your immune system\'s health and ability to combat illness. It does this accurately and non-invasively in 90 seconds, with no needles, no pain and no stress.</p>\r\n<p>The scanner will provide you with a scientifically validated measurement of how well your diet, exercise and lifestyle are protecting your bodies\' cells and your overall health.</p>\r\n\r\n<p>Each employee receives an explanatory booklet and a scan card which records their score.</p>\r\n<p class=\"text-align-left\">&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; &#160;&#160;&#160; <img class=\"text-align-center\" rel=\"225x255\" alt=\"Wellness Team\" title=\"Wellness Team\" src=\"../../../system/images/BAhbB1sHOgZmSSIuMjAxMi8wMy8wNi8xMF8zMF8xNV8yMjZfV2VsbG5lc3NfVGVhbS5qcGcGOgZFVFsIOgZwOgp0aHVtYkkiDTIyNXgyNTU+BjsGVA/Wellness%20Team.jpg\" height=\"56\" width=\"225\" /></p>\r\n<p class=\"text-align-left\"></p>\r\n\r\n<h2>Massage</h2>\r\n\r\n<p><br />We provide professional massage therapists with specialist ergonomic chairs and head rests to give a fully clothed neck and shoulder massage.My 5&#160;offer a comprehensive workplace massage service. Massage is a great way to re-energise your employees without having to leave their desks.</p>\r\n\r\n<p>Massages can last from 5 to 30 minutes depending on your requirements and can be performed at the desk or in a specified room.</p>\r\n<p>Massage can help to:</p>\r\n<ul><li>Reduce stress</li>\r\n<li>Release muscular tension and pain&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; </li>\r\n<li>Help increase motivation and performance levels</li>\r\n<li>Help your employees to feel re-energised and refocused</li>\r\n</ul>\r\n<p>How does it work?</p>\r\n<p>We will come to your business location. We offer an on line booking system with flexible scheduling options.</p>\r\n<p class=\"text-align-center\"><a target=\"_blank\" title=\"http://www.corporatebodies.com/\" href=\"http://www.corporatebodies.com/\"><img class=\"image-align-center text-align-center\" rel=\"225x255\" alt=\"Corporate Bodies\" title=\"Corporate Bodies\" src=\"/system/images/BAhbB1sHOgZmSSIxMjAxMi8wMy8wNS8xN18xMF80OV8xMjJfQ29ycG9yYXRlX0JvZGllcy5qcGcGOgZFVFsIOgZwOgp0aHVtYkkiDTIyNXgyNTU+BjsGVA/Corporate%20Bodies.jpg\" height=\"47\" width=\"225\" /></a>&#160;&#160;&#160;&#160;&#160; </p>\r\n<p class=\"text-align-center\"><a target=\"_blank\" title=\"http://www.corporatemassagetherapy.com.au\" href=\"http://www.corporatemassagetherapy.com.au\"><img rel=\"225x255\" alt=\"Therapy 4 U Logo\" title=\"Therapy 4 U Logo\" src=\"/system/images/BAhbB1sHOgZmIjEyMDEyLzA3LzI2LzA0XzExXzU0XzIyM190aGVyYXB5XzRfdV9sb2dvLkpQR1sIOgZwOgp0aHVtYiINMjI1eDI1NT4/therapy%204%20u%20logo.JPG\" height=\"169\" width=\"225\" /></a>\r\n</p>','2012-02-29 00:04:23','2012-07-28 06:23:44'),(93,93,'en','','2012-02-29 00:04:23','2012-02-29 00:04:23'),(94,94,'en','<p><span class=\"text-align-center\">My 5 offers health and well being workshops and seminars.</span>\r\n</p>\r\n<br />\r\n','2012-02-29 06:07:02','2012-07-04 09:25:53'),(95,95,'en','','2012-02-29 06:07:02','2012-02-29 06:07:02'),(100,100,'en','','2012-07-09 11:09:21','2012-07-09 11:09:21'),(101,101,'en','','2012-07-09 11:09:21','2012-07-09 11:09:21'),(102,102,'en','<h3>My 5 offers the individual user a 12 month membership which gives you:</h3>\r\n<ul><li>Full access to all of the content in My 5 online</li>\r\n<li>The ability to use My 5 anywhere you can connect to the internet</li>\r\n<li>This includes mobile devices such as the iPad and Galaxy Tab</li>\r\n</ul>\r\n<h3>My 5 has been carefully designed to:</h3>\r\n<ul><li>Help to prevent and alleviate many of the pains and typical health issues commonly associated with long term computer usage</li>\r\n<li>Be easy and enjoyable to use</li>\r\n<li>Help to improve concentration and reduce stress</li>\r\n<li>Help you to keep track of your progress and general wellbeing</li>\r\n</ul>\r\n<p>So whether you use your computer for work, study or regularly at home, My 5 offers you an effective wellbeing program that can help you be happier, healthier and more productive.</p>\r\n<p><a href=\"/customers/sign_up\" class=\"button\">Start free 10 day trial</a>\r\n</p>','2012-07-09 11:13:25','2012-07-09 11:13:25'),(103,103,'en','','2012-07-09 11:13:25','2012-07-09 11:13:25'),(104,104,'en','<h3>My 5 offers Corporate users:</h3>\r\n<ul><li>Multi-user licensing</li>\r\n<li>Significant discounts for more than 100 users</li>\r\n<li>My 5 is entirely web based, and can be rapidly deployed with no installation needed. This allows your employees to access My 5 Online at work, home or anywhere they can connect to the internet.</li>\r\n<li>My 5 allows you the opportunity to co-brand, and gives you the ability to link with and complement any existing workplace wellbeing initiative you are currently offering your employees.</li>\r\n<li>In depth customisable reporting and expert assistance with interpretation of the findings, giving your business valuable information about the health and engagement levels of your work force.</li>\r\n</ul>\r\n\r\n\r\n\r\n\r\n<h3>My 5 Enterprise packages offers users:</h3>\r\n<p>All of the benefits of the Corporate package, with innovative and effective extras including:</p>\r\n<ul><li>Tailored workshops such as Stretching and Posture/Stress Management/Emotional awareness and management.</li>\r\n<li>Train the trainer support, to help your team stay motivated and get the maximum benefits from the My 5 program</li>\r\n<li>Workplace massages customised to suit your needs</li>\r\n</ul>\r\n<h3><br />Please <a title=\"Contact Us\" href=\"/home/contact-us\" class=\"green\">click here</a> to contact us for further information and to arrange a discussion about your organisation\'s particular needs\r\n\r\n</h3>','2012-07-09 11:14:52','2012-07-09 11:14:52'),(105,105,'en','','2012-07-09 11:14:52','2012-07-09 11:14:52');
