INSERT INTO `page_parts` VALUES (3,2,'Body','<h2>Sorry, there was a problem...</h2><p>The page you requested was not found.</p><p><a href=\'/\'>Return to the home page</a></p>',0,'2011-08-12 03:43:02','2011-08-12 03:43:02'),(7,4,'Side Body','',0,'2011-08-12 04:57:41','2012-10-21 11:23:40'),(12,7,'Body','',0,'2011-08-12 05:49:02','2011-08-16 02:48:48'),(13,7,'Side Body','',1,'2011-08-12 05:49:02','2011-08-16 02:48:48'),(14,8,'Body',NULL,NULL,'2011-08-13 00:45:51','2011-08-13 00:45:51'),(15,8,'Side Body',NULL,NULL,'2011-08-13 00:45:51','2011-08-13 00:45:51'),(16,9,'Body','',0,'2011-08-13 01:10:00','2011-08-15 05:19:45'),(17,9,'Side Body','',1,'2011-08-13 01:10:01','2011-08-15 05:19:45'),(19,1,'Heading','<h1>Effective Workplace&#160; <br />Health Solutions</h1>\r\n<p><strong>My 5 Online </strong>is a unique, sophisticated and interactive approach to workplace health and wellness that:</p>\r\n<ul><li>Reduces stress and postural aches and pains</li>\r\n<li>Stimulates focus and enhances productivity and efficiency</li>\r\n<li>Provides direct cost savings from reduced absenteeism</li>\r\n<li>Leads to improved employee engagement with a healthier, happier workforce</li>\r\n<li>Results in an increased bottom line and significant return on investment</li>\r\n</ul>\r\n<p>Discover the benefits of the My 5 Online wellness program now.</p>',0,'2011-08-15 05:11:07','2012-03-15 04:54:18'),(20,1,'Verb1','<h2><a title=\"Services\" href=\"/home/services\">Seminars\r\n</a>\r\n</h2>\r\n<ul><li>Stretching and posture</li>\r\n<li>Back and spine care</li>\r\n<li>Stress Management</li>\r\n<li>Nutrition/Healthy eating at work</li>\r\n<li>Absenteeism and Presenteeism</li>\r\n</ul>',1,'2011-08-15 05:11:07','2012-03-15 04:54:18'),(21,1,'Verb2','<h2><a title=\"Services\" href=\"/home/services\">Assessments</a>\r\n</h2>\r\n<p>Our health assessments will help to give you an indicator of the health of your work force\'s immune system and its ability to combat illness</p>\r\n',2,'2011-08-15 05:11:07','2012-03-15 04:54:18'),(22,1,'Verb3','<h2><a title=\"Services\" href=\"/home/services\">Massage</a>\r\n</h2>\r\n<p>Corporate massage assists in reducing stress, releases muscular tension, and helps to motivate, energise and refocus employees in the workplace</p>\r\n',3,'2011-08-15 05:11:43','2012-03-15 04:54:18'),(23,1,'Verb4','<h2>Reports</h2>\r\n<p>My 5 Online offers a detailed reporting tool for employers and a personal health check for employees to monitor energy, health and stress levels.&#160; <a target=\"_blank\" title=\"http://dl.dropbox.com/u/28745615/My%205%20corporate%20dashboard%202012.pdf\" href=\"http://dl.dropbox.com/u/28745615/My%205%20corporate%20dashboard%202012.pdf\">Click here </a>for an example.</p>\r\n',4,'2011-08-15 05:11:43','2012-03-15 04:54:18'),(24,1,'Quote','<h3>My 5 offers employers detailed reporting on the My 5 Online program and how it is being utilised by their team including key information about current health trends within their business and highlighting potential areas where there may be health issues that need further investigation. My 5 offers expert analysis on the reports provided and will aim to recommend strategies to address health issues highlighted from the report.&#160; For further information, please click <a target=\"_blank\" title=\"http://dl.dropbox.com/u/28745615/My%205%20corporate%20dashboard%202012.pdf\" href=\"http://dl.dropbox.com/u/28745615/My%205%20corporate%20dashboard%202012.pdf\">here</a>\r\n</h3>',5,'2011-08-15 05:15:50','2012-03-15 04:54:18'),(29,10,'Body',NULL,NULL,'2011-08-23 02:05:05','2011-08-23 02:05:05'),(30,10,'Side Body',NULL,NULL,'2011-08-23 02:05:05','2011-08-23 02:05:05'),(31,11,'Body',NULL,NULL,'2011-08-23 02:23:32','2011-08-23 02:23:32'),(32,11,'Side Body',NULL,NULL,'2011-08-23 02:23:32','2011-08-23 02:23:32'),(33,12,'Body',NULL,NULL,'2011-09-06 01:54:42','2011-09-06 01:54:42'),(34,12,'Side Body',NULL,NULL,'2011-09-06 01:54:42','2011-09-06 01:54:42'),(35,13,'Body',NULL,NULL,'2011-09-06 02:32:41','2011-09-06 02:32:41'),(36,13,'Side Body',NULL,NULL,'2011-09-06 02:32:41','2011-09-06 02:32:41'),(38,4,'Telephone','<p>In Australia: (02) 8985 7131</p>\r\n<p>Outside Australia: +61 2 8985 7131</p>',1,'2011-09-12 04:02:07','2012-10-21 11:24:44'),(39,3,'About page part one','<p>My 5 reminds you to take a few minutes out of the day to look after YOU.  Take five minutes to take a break from your work – to stretch, exercise, re-energise and re-focus.&#160; In a world where we are all working harder and longer, My 5 provides you with the tools and inspiration to help you do more to look after yourself whether at work and at home.&#160; Just as anti-virus software offers protection for the smooth running and health of your computer, My 5 software provides health and wellness solutions for you.</p>\r\n<p>Employers are increasingly concerned with the wellbeing of their employees and searching for ways to make a difference.  My 5 offers practical help with day to day workplace health and wellness issues via My 5 online.</p>\r\n<p>The number five has a great significance in our lives.  It’s through our five senses that we experience life.  In Eastern medicine, there are five elements (earth, fire, water, metal and wood).  The number five also represents the balance point, embodying the characteristics of health, creativity, versatility and adaptability to change.</p>',0,'2011-09-12 06:09:43','2012-03-05 02:10:58'),(40,3,'About page part two','<p>The My 5 program has been developed with the above characteristics in mind, combining a range of different approaches including stretching, muscle balance exercises and pressure point massage.</p>',1,'2011-09-12 06:09:43','2012-03-05 02:10:58'),(41,6,'Symptomatics','<p><img src=\"/system/images/BAhbBlsHOgZmSSItMjAxMS8xMC8yNi8yM181MV8yNV8xMDNfU3ltcHRvbWF0aWNzLmpwZwY6BkVU/Symptomatics.jpg\" title=\"Symptomatics\" alt=\"Symptomatics\" height=\"308\" width=\"637\" />The Symptomatic Guide takes you straight to exercises that target the part of the body that is causing discomfort. This is designed to give you quick and easy access to the exercises, making it the ideal way for busy people to use the &#160;My 5 program.</p>',0,'2011-09-20 02:56:12','2012-05-20 11:33:56'),(42,6,'Mini Modules','<p><img src=\"/system/images/BAhbBlsHOgZmSSItMjAxMS8xMC8yNi8yM181MV81Ml81NDhfbWluaV9tb2R1bGVzLmpwZwY6BkVU/mini_modules.jpg\" title=\"Mini Modules\" alt=\"Mini Modules\" rel=\"225x255\" height=\"324\" width=\"640\" />Each Mini Module comprises a series of short exercises tailored to give you an effective sequence addressing a particular theme:</p>\r\n<ul><li>Wake Up Exercises</li>\r\n<li>Kick Start Your Day</li>\r\n<li>Work Station Workout</li>\r\n<li>Energise</li>\r\n<li>Back Care </li>\r\n<li>De-Stress\r\n</li>\r\n</ul>',1,'2011-09-20 02:57:22','2012-05-20 11:33:56'),(43,6,'Audio Programs','<p><img src=\"/system/images/BAhbBlsHOgZmSSIvMjAxMS8xMC8yNi8yM181NF8yMF8xODlfYXVkaW9fcHJvZ3JhbXMuanBnBjoGRVQ/audio_programs.jpg\" title=\"Audio Programs\" alt=\"Audio Programs\" rel=\"225x255\" height=\"332\" width=\"640\" />The Audio Programs offer further techniques and strategies to help improve your wellbeing, including:</p>\r\n<ul><li>Stress Buster Exercises</li>\r\n<li>Concentration and Focus Exercises</li>\r\n<li>Eye Exercises</li>\r\n</ul>',2,'2011-09-20 02:58:16','2012-05-20 11:33:56'),(44,6,'My EQ','<p><img src=\"/system/images/BAhbBlsHOgZmSSIlMjAxMS8xMC8yNi8yM181NF80Ml8yNzhfTXlFUS5qcGcGOgZFVA/MyEQ.jpg\" title=\"My Eq\" alt=\"My Eq\" rel=\"225x255\" height=\"323\" width=\"640\" />Emotions are an integral part of how we think, reason, engage and communicate from day to day.  Emotional intelligence is a measure of how effectively we manage the interplay between thought and emotion, both for ourselves and when interacting with others.  When our emotions are appropriately expressed and balanced, we make better decisions, our problem solving abilities improve, and we can cope with change and life’s challenges more effectively.  My EQ leads you through a practical five step process to help you increase self awareness and social awareness, improving self management and enhancing your relationship management skills.</p>',3,'2011-09-20 02:59:02','2012-05-20 11:33:56'),(45,6,'Health Check-In','<p><img src=\"/system/images/BAhbBlsHOgZmSSIvMjAxMS8xMC8yOC8xM18wOV81MF84OTJfaGVhbHRoX2NoZWNraW4ucG5nBjoGRVQ/health_checkin.png\" title=\"Health Checkin\" alt=\"Health Checkin\" rel=\"225x255\" height=\"386\" width=\"634\" />The personal Health Check In allows you to record your energy, stress and comfort levels and to monitor how these are changing over time.  You can use this to gauge your progress.</p>',4,'2011-09-20 02:59:02','2012-05-20 11:33:56'),(46,6,'Timed Reminders','<p>The Timed Reminder allows you to set a customised alert to remind you to use the program, drink water or take a break.  Alternatively you can create your own personal reminder.</p>\r\n<p><img src=\"/images/pages/features/reminder_screenshot.jpg\" alt=\"Reminder Emails Screenshot\" /></p>',5,'2011-09-20 02:59:02','2012-05-20 11:33:56'),(47,14,'Body',NULL,NULL,'2011-09-26 02:46:21','2011-09-26 02:46:21'),(48,14,'Side Body',NULL,NULL,'2011-09-26 02:46:21','2011-09-26 02:46:21'),(49,15,'Body',NULL,NULL,'2011-09-26 05:23:11','2011-09-26 05:23:11'),(50,15,'Side Body',NULL,NULL,'2011-09-26 05:23:11','2011-09-26 05:23:11'),(52,1,'Workplace','<p>Every year a significant amount of productive business time is lost as a result of workplace injuries.  Even in a seemingly safe environment such as an office or call centre, people who spend a significant amount of time sitting at a desk or using a computer are at risk from a variety of common complaints and potential injuries.</p>\r\n<p>Many of us have suffered from problems such as back pain, headaches, fatigue or stress, which reduces performance at work.  In contrast, employees who are healthy and well are likely to be more productive. For example, a recent study by Medibank Private found that:<br />•	Healthy employees are nearly three times more productive than unhealthy employees<br />•	Unhealthy employees take up to nine times more sick leave than their healthy colleagues<br />•	Poor employee health and absenteeism costs Australian businesses $7 billion a year<br />For more statistics from the Medibank Private study or for more articles on workplace health, click on Workplace Health Articles below.</p>\r\n<p>Employers continue to look for new ways to help their staff avoid or mitigate these problems, as they are aware of the beneficial impact this has upon employee welfare, engagement and productivity.  The My 5 program is an ideal way to invest in the health and wellness of your employees.</p>\r\n<p>The program has been designed with corporate use specifically in mind.  The program is entirely web-based, allowing it to be rapidly deployed in your workplace, with no installation required.&#160; In addition, My 5 offers employers customised reporting and expert assistance with the analysis and interpretation of reports on the health and wellness of your workforce.&#160; </p>',6,'2011-09-27 11:05:17','2012-03-15 04:54:18'),(53,16,'Body','<p>Every year a significant amount of productive business time is lost as a result of workplace injuries.  Even in a seemingly safe environment such as an office or call centre, people who spend a significant amount of time sitting at a desk or using a computer are at risk from a variety of common complaints and potential injuries.</p>\r\n<p>Many of us have suffered from problems such as back pain, headaches, fatigue or stress, which reduces performance at work.  In contrast, employees who are healthy and well are likely to be more productive. For example, a recent study by Medibank Private found that:</p>\r\n<p>•	Healthy employees are nearly three times more productive than unhealthy employees<br />•	Unhealthy employees take up to nine times more sick leave than their healthy colleagues<br />•	Poor employee health and absenteeism costs Australian businesses $7 billion a year</p>\r\n<p>Employers continue to look for new ways to help their staff avoid or mitigate these problems, as they are aware of the beneficial impact this has upon employee welfare, engagement and productivity.  The My 5 program is an ideal way to invest in the health and wellness of your employees.</p>\r\n<p>The program has been designed with corporate use specifically in mind.  The program is entirely web-based, allowing it to be rapidly deployed in your workplace, with no installation required.&#160; In addition, My 5 offers employers customised reporting and expert assistance with the analysis and interpretation of reports on the health and wellness of your workforce. </p>',0,'2011-09-27 11:10:14','2012-03-04 10:04:04'),(54,16,'Side Body','',1,'2011-09-27 11:10:14','2012-03-04 10:04:04'),(63,21,'Body','<p><img src=\"/system/images/BAhbBlsHOgZmSSI5MjAxMS8xMC8yNS8xMF8xMV8zMF80NzBfYWJvdXRfbXk1X3ZhbHVlc19jcm9wcGVkLmpwZwY6BkVU/about_my5_values_cropped.jpg\" title=\"About My5 Values Cropped\" alt=\"About My5 Values Cropped\" rel=\"225x255\" height=\"505\" width=\"308\" /></p>',0,'2011-10-07 05:04:50','2012-07-09 11:29:05'),(65,22,'Body','<p><img src=\"/system/images/BAhbBlsHOgZmSSI2MjAxMS8xMC8yMS8xMl8yOF8xNV83OTRfcGVvcGxlX3BhZ2VfMl9jcm9wcGVkLmpwZwY6BkVU/people_page_2_cropped.jpg\" title=\"People Page 2 Cropped\" alt=\"People Page 2 Cropped\" rel=\"225x255\" width=\"308\" height=\"505\" /></p>',0,'2011-10-07 05:05:09','2011-10-24 23:11:53'),(67,23,'Body','<h2>My 5 was founded by Tim Norris, an internationally accredited practitioner who has 20 years experience in the fields of natural health and fitness.</h2>\r\n<p>Tim worked in one of the UK\'s leading health clubs as a personal trainer and Pilates teacher for over 7 years.  His year as a health consultant and bodywork practitioner at the BBC in 2003 inspired him to continue his work in the corporate workplace to enhance computer users\' wellbeing. </p>\r\n<p>Tim became aware of the need to address more effectively the typical complaints and issues that presented within a workplace.  Together with a number of highly qualified and experienced practitioners, he has been able to structure and develop the My 5 program to significantly alleviate the aches and pains commonly associated with extended computer usage.</p>\r\n<p>Tim\'s experience in the corporate workplace is supported by extensive training and qualifications in a range of natural health modalities, including:</p>\r\n<ul><li>    Fitness consultant</li>\r\n<li>Sports therapy, rehabilitation and massage</li>\r\n<li>Pilates</li>\r\n<li>Acupuncture</li>\r\n<li>Bowen technique</li>\r\n<li>Kinesiology</li>\r\n<li>Bio-energetics</li>\r\n</ul>\r\n<p style=\"font-style: italic;\">\"I’m passionate about helping people to learn more about what causes their day to day health and wellness problems.  By inspiring people to understand their body’s needs better, I can empower them to take more responsibility for their own wellbeing.  I see the My 5 software program as one of the ways I can achieve this.\" </p>',0,'2011-10-07 05:05:29','2011-12-02 01:50:12'),(68,23,'Side Body','',1,'2011-10-07 05:05:29','2011-12-02 01:50:12'),(69,24,'Body','<h2>Stephanie Campanale, Key Media</h2>\r\n<p>It was our pleasure to work with Tim Norris of My 5 at the National HR Summit 2012. Tim led our audience of 300+ delegates in a series of exercises to “wake up” and energize them during the day of presentations. The audience enjoyed the stretches and realised that these techniques are easy to implement and would improve their team’s performance during the daily work day. </p>\r\n<p>The My 5 techniques strengthen healthy workplace strategies and practices. </p>\r\n<h2>QBE LMI</h2>\r\n<p>Tim recently facilitated a one hour workshop for employees across a number states. The workshop covered a range of specific stretches and postural exercises for the workplace environment that can help improve posture and release muscular tension. Our employees found the workshop very practical with many really enjoying the opportunity to practise what they\'ve learnt. I\'ve seen many of the posters Tim provided hanging around the office and people were really keen to practice their stretches. Thanks Tim for a great practical workshop!</p>\r\n<h2>CMC Markets Asia Pacific</h2>\r\n<p>I thought his approach, techniques and teaching methods were great - very clear and precise. Tim always kept in mind that we are in an office environment and the stretches he showed us were appropriate. He also showed us some that as he mentioned should be done at home. Tim came around and made sure we were all doing the particular movements correctly as to not harm ourselves. The cards and posters he left us to put around the office and to take away and to keep reminding us were great too. If anyone had any questions I thought that he answered them with a lot of fact and satisfied the person asking the question and also made further suggestions to assist in particular parts of the body that were causing problems.</p>\r\n<h2>Christine Ammann, Kinesiologist, SA</h2>\r\n<p>I love the My5 program as it incorporates a quick fix for everyone at any time, combining five very powerful modalities that work extremely well together.  When doing my administration work I often spend long periods of time sitting in front of my computer or marking assignments, and I guess, like most people, forget to take a break every so often.  By the end of the day of course, I end up with sore shoulder and neck muscles and weary eyes!  Having the program loaded onto my computer with the timely reminder set - I can relax and focus on my work until I am told what to do!  Being able to choose from different techniques without much fuss is great and improves my productivity - plus I still have enough energy left at the end of the day to spend time with my family without being tired, grumpy or sore - laugh!</p>\r\n<h2>Angela Stott, La Source International</h2>\r\n<p>When looking at options where we wanted to not only retain our staff but also promote well being in the work place, we were finding it a challenge to find a concept that would really work without taking up too much employee time.  Once we signed up to the program, we were instantly impressed with the ease of functionality of the program, the appeal to our employees and also the sheer professionalism of it all.  It is a seamless journey for the user and a valuable tool for any company looking to invest that little extra in their team.</p>\r\n<h2>Mimi Fong, Amicas Global&#160;</h2>\r\n<p>My 5 impressed me with its innovative yet simple approach to wellness in the workplace. It takes the basic principle of \" Healthier employees equals greater productivity levels\" and transforms this into easy to follow exercises which can be done anywhere in the workplace. My 5 has made a tangible difference to my business particularly in boosting concentration and alertness levels throughout the day. It is a must for any organisation serious in their commitment towards maintaining and enhancing the health and wellbeing of their most valuable assets - their employees.</p>',0,'2011-10-07 05:05:44','2012-05-06 23:57:08'),(70,24,'Side Body','',1,'2011-10-07 05:05:44','2012-05-06 23:57:08'),(71,25,'Body','<h2>The My 5 team is growing! </h2>\n<p>We are often on the look out for motivated, energetic and dedicated people to join our team.&#160; Watch this space for upcoming positions.</p>\n<p>We offer employees the opportunity to work in a dynamic and respectful environment. We are committed to helping each member of our team reach their full potential. Importantly, My 5 supports the commitment of its employees to the community.</p>\n<p>If you are interested, please <a title=\"Contact Us\" href=\"/home/contact-us\">drop us a line</a>.</p>',0,'2011-10-07 05:06:02','2011-10-11 21:19:52'),(72,25,'Side Body','',1,'2011-10-07 05:06:03','2011-10-11 21:19:52'),(73,26,'Body','<p><img src=\"/system/images/BAhbBlsHOgZmSSI4MjAxMS8xMC8yNS8xMF8xMV8wMV84MV9hYm91dF9teTVfdmlzaW9uX2Nyb3BwZWQuanBnBjoGRVQ/about_my5_vision_cropped.jpg\" title=\"About My5 Vision Cropped\" alt=\"About My5 Vision Cropped\" rel=\"225x255\" width=\"308\" height=\"505\" /></p>',0,'2011-10-07 05:06:15','2011-10-24 23:11:07'),(75,27,'Body','<p>This is test text for a page.</p>',0,'2011-10-07 05:06:35','2011-10-07 05:07:20'),(76,27,'Side Body','',1,'2011-10-07 05:06:35','2011-10-07 05:07:20'),(77,28,'Body','',0,'2011-10-07 05:06:46','2012-03-01 04:21:12'),(78,28,'Side Body','',1,'2011-10-07 05:06:46','2012-03-01 04:21:12'),(79,29,'Body','<p>This is test text for a page.</p>',0,'2011-10-07 05:07:00','2011-10-07 05:07:00'),(80,29,'Side Body','',1,'2011-10-07 05:07:00','2011-10-07 05:07:00'),(81,30,'Body',NULL,NULL,'2011-10-12 12:09:09','2011-10-12 12:09:09'),(82,30,'Side Body',NULL,NULL,'2011-10-12 12:09:09','2011-10-12 12:09:09'),(83,22,'Right Content','<h2>My 5 reflects the expertise of a wide range of skilled practitioners</h2>\r\n<p>This expertise covers a variety of approaches to natural health and wellness.  We have synthesized their approaches to wellness to give you a dynamic health program that infuses the latest fitness concepts from the West with the ancient arts of the East.</p>',1,'2011-10-20 07:06:23','2011-10-24 23:11:53'),(84,21,'Right Content','<h2>We are passionate in our desire to deliver products and solutions that are simple and practical and that really work, reflected in our values:</h2>\r\n<ul><li>    <strong>Inspire</strong> and motivate you to seek improvement in your physical, mental and emotional wellbeing</li>\r\n<li><strong>Empower </strong>you to make changes, through giving you the tools you need to have a real impact on how you feel</li>\r\n<li><strong>Re-energise </strong>you through transporting you to an invigorating environment that re-energises and recharges</li>\r\n<li><strong>Deliver </strong>you simple and effective answers to common health issues, drawing on both Eastern and Western perspectives</li>\r\n<li>Benefits that e<strong>ndure</strong>, offering lasting results</li>\r\n</ul>',1,'2011-10-20 07:07:36','2012-07-09 11:29:05'),(85,26,'Right Content','<h2>My body... My life... My 5</h2>\r\n<p>Our vision embodies our commitment to helping you get more out of your life – both at work and at play.&#160;  Long hours spent sitting or using a computer can place a significant strain on your body.  We know this, and look to offer you welcome respite for mind and body.</p>\r\n<p>My 5 \'s mission is to empower each individual to manage their own health and wellbeing.  In particular, My 5 offers:</p>\r\n<ul><li>    Products</li>\r\n<li>Services</li>\r\n<li>Education and information</li>\r\n<li>Inspiration and motivation</li>\r\n</ul>\r\n<p>All of these are designed to help you enhance your health and wellbeing.</p>',1,'2011-10-20 07:08:14','2011-10-24 23:11:07'),(86,31,'Body','<h3>GENERAL</h3>\r\n<p>Your subscription to My 5 Online allows you to access the My 5 service.  The My 5 concept, services, design, logo and all associated materials remain the property of My 5 Pty Ltd (ACN 121 460 517) and/or My 5 Developments Ltd (ACN 122 987 624).  You should not install and use My 5 Online if to do so would result in the breach of any law in the country or territory in which you are located.  BY accessing My 5 Online, you agree as follows:</p>\r\n<h3>MEDICAL WARNING</h3>\r\n<p>If you have not undertaken any physical activity for some time, are over 40 and relatively inactive, or have a history of heart or other health problems, please be careful using My 5 Online.  If in any doubt, consult your doctor before using My 5 Online.  If you feel any discomfort whilst using My 5 Online, stop immediately and seek professional medical assistance.  While every effort has been taken to make My 5 Online safe and enjoyable, no responsibility is taken by My 5 for any injury sustained while using My 5 Onl